	static void CreateShapeWithTriangles(string id, float[][] p_vertices, int[][] p_triangles)
	{
		Vector2[] points = new Vector2[p_vertices.Length];
		for (int i = 0; i < p_vertices.Length; i++)
        {
			points[i] = new Vector2(p_vertices[i][0], p_vertices[i][1]);
        }

		List<int> triangles = new List<int>();
		for(int i = 0; i < p_triangles.Length; i++)
		{
			triangles.Add(p_triangles[i][0]);
			triangles.Add(p_triangles[i][1]);
			triangles.Add(p_triangles[i][2]);
		}

		string filePath = "Assets/USDA/Prefabs/Counties/" + id + ".asset";
		int[] indices = triangles.ToArray(); 
		Vector3[] vertices = new Vector3[points.Length];
		for (int i = 0; i < vertices.Length; i++)
		{
			vertices[i] = new Vector3(points[i].x, 0.0f, points[i].y);
		}
		Mesh msh = new Mesh();
		msh.vertices = vertices;
		msh.triangles = indices;
		msh.RecalculateNormals();
		msh.RecalculateBounds();
		AssetDatabase.CreateAsset(msh, filePath);
	}

	[System.Serializable]
	public class MeshInfo
    {
		public float[][] vertices { get; set; }
		public int[][] triangles { get; set; }
    }


	public static void CreateCountyShape(string ID)
    {
		try
		{
			MeshInfo meshInfo = JsonConvert.DeserializeObject<MeshInfo>(File.ReadAllText(@"PyDataPrep/CountyJSON/" + ID + ".unity.json"));
			CreateShapeWithTriangles(ID, meshInfo.vertices, meshInfo.triangles);
		} 
		catch(System.Exception e)
        {
			// this is where file lookup fails go
			UnityEngine.Debug.Log(e.Message);
        }
    }


